  }
};

class Navigation extends Component {
	render() {
		const { counter, onDecrement, dupaWolowa } = this.props;

		return ( <>
			<Navbar bg="light">
				<button className="btn btn-outline-dark font-weight-bold mr-2" type="button" onClick={ this.handleOnSaveClick }>Zapisz</button>

			</Navbar>
		</> );
